import React, {Component} from 'react';
import './App.css';
import Menu from "./components/Menu";
import {BrowserRouter as Router} from "react-router-dom";

class App extends Component {
    render() {
        return (
            <Router>
                <div>
                    <Menu/>
                </div>
            </Router>
        );
    }
}

export default App;
